#' @param readGroupSetIds IDs of the read group sets that were created
#' 
#' @return ImportReadGroupSetsResponse object
#' 
#' @family ImportReadGroupSetsResponse functions
#' @export
ImportReadGroupSetsResponse <- function(readGroupSetIds = NULL) {
    structure(list(readGroupSetIds = readGroupSetIds), class = "gar_ImportReadGroupSetsResponse")
}


